const projects = ['THE OFFICE','DAILY','FUTURE','WORDS','MUSIC'];

const Styledli = styled.li`
    list-style-type: none;
    color: #333;
    display: -webkit-box;
    display: -ms-flexbox;
    display: flex;
    cursor: pointer;
    line-height: 1.50;
    font-size: 15px;
    padding-left: 0;
    padding-right: 0;
`

